import { Header } from "./components/Header";
import { Meme } from "./components/Meme";
import Box from "@mui/material/Box";

function App() {
  return (
    <div>
      <Header />
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        minHeight="100vh"
      >
        <Meme />

      </Box>
    </div>
  );
}

export default App;
